import React from 'react';

function About() {
  return (
  <div>
      <p>
        My name is Max Liu, and I am a senior at The Pingry School.
        I decided to make this online deep learning course to help people learn
        about this exciting field at their own pace. Please feel free to email/dm
        me with any suggestions! The "About Me" section gives more detail about my
        background, personal interests, and contact information.
      </p>
  </div>)
}
export default About;
